import React from 'react'
import ReactDOM from 'react-dom';
import Card from './Card';
import "./index.css"
import Sdata from './sdata';

ReactDOM.render(
  <>
    <h1 className='heading_style'>Top Netflix Web Series</h1>

    <Card 
      imgsrc={Sdata[0].imgsrc} 
      title={Sdata[0].title}
      sname={Sdata[0].sname}
      links={Sdata[0].links}
    />


  </>
  ,
  document.getElementById('root')
);
